sys_variable_value.value:
(function execute(inputs, outputs) {
  // Test Vars
appID = inputs.product_id; 

gs.info('Product ID Is: ' + inputs.product_id);
var cart = new sn_sc.CartJS();

var catItem = new GlideRecord('sc_cat_item');
catItem.addQuery('name', 'CONTAINS', 'Configure Service Desk');
catItem.addQuery('sys_scope', appID);
catItem.query();

gs.info('Rows Returned Is: ' + catItem.getRowCount());
if (catItem.next()) {
    // gs.info('Cat Item is: ' + catItem.sys_id);


    var newItem = cart.addToCart({
        "sysparm_id": catItem.sys_id.toString(),
        "sysparm_quantity": "1",
        "variables": {
            "make_changes_to_product": "Yes",
            "new_product_name": inputs.product_name.toString(),
            "delivery_root_dir": inputs.delivery_root_dir.sys_id.toString(),
            "product_model_table": inputs.product_model_table.toString()
        }
    });
outputs.output = cart.checkoutCart();

}
})(inputs, outputs);

